// NavigationBar.js
import React from 'react';

const NavigationBar = ({ onSafetyBoxClick, onCCTVClick, activePage }) => {
  return (
    <div>
      <button onClick={onSafetyBoxClick}>Safety Box Information</button>
      <button onClick={onCCTVClick}>Checking CCTV</button>
      <div>Current Page: {activePage}</div>
    </div>
  );
};

export default NavigationBar;
